/* eslint-disable react/prop-types */

import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import api from '../../service/api';
import Footer from '../../Components/Footer';
import NavBar from '../../Components/NavBar';

import {
  faThumbsUp,
  faEye,
  faSmileBeam,
  faCalendarDay,
  faThumbsDown,
  faFaceFrown,
  faFaceGrimace,
  faFaceSmile,
} from '@fortawesome/free-solid-svg-icons';

import musicImage from '../../assets/music.jpg';
import waveImage from '../../assets/dQw4w9WgXcQ.png';

import style from './style.module.css';

import { Parallax } from 'react-parallax';

import classNames from 'classnames';

import notAvailable from '../../assets/notAvailable.svg';

import loading from '../../assets/loading.svg';

import { formatDate } from '../../Utils.js';

const Music = () => {
  const { external_id } = useParams();
  const [song, setSong] = useState();

  const [needsAuth, setNeedsAuth] = useState(false);
  const [isLoading, setisLoading] = useState(true);

  const [agrees, setAgrees] = useState(0);
  const [disagrees, setDisagrees] = useState(0);
  const [date, setDate] = useState(new Date());

  const [userId, setUserId] = useState(0);

  //Variable to stay in track wether a user has liked the song classification or not
  const [hasLiked, setHasLiked] = useState(0);
  const [hits, setHits] = useState(0);
  const [emotionIcon, setEmotionIcon] = useState();

  const getSong = async () => {
    try {
      const { data } = await api.get(`/song/${external_id}`);
      setSong(data);
    } catch (error) {
      if (error.response) {
        console.log(error.response.data); // Logs server error message
      } else if (error.request) {
        console.log(error.request); // Logs request if no response is received
      } else {
        console.log('Error', error.message); // Logs any other errors
      }
    } finally {
      setisLoading(false); // Ensure loading state is set to false regardless of success or failure
    }
  };

  const getAgrees = async () => {
    try {
      const { data } = await api.get(`/feedback/agrees/${song.id}`);
      setAgrees(data);
    } catch (error) {
      if (error.response) {
        console.log(error.response.data); // Corrected: Logs server error message
      } else if (error.request) {
        console.log(error.request); // Logs request if no response is received
      } else {
        console.log('Error', error.message); // Logs any other errors
      }
    }
  };

  const getDisagrees = async () => {
    try {
      const { data } = await api.get(`/feedback/disagrees/${song.id}`);
      setDisagrees(data);
    } catch (error) {
      if (error.response) {
        console.log(error.response.data); // Logs server error message
      } else if (error.request) {
        console.log(error.request); // Logs request if no response is received
      } else {
        console.log('Error', error.message); // Logs any other errors
      }
    }
  };

  const agreeOrDisagree = async (id) => {
    if (!localStorage.getItem('token')) {
      setNeedsAuth(!needsAuth);
    } else {
      try {
        // The same API is called regardless of whether the user agrees or disagrees
        await api.post(`/feedback/agree/disagree/${id}/user/${userId}/song/${song.id}`);

        // Refresh agree/disagree counts
        getAgrees();
        getDisagrees();
      } catch (error) {
        if (error.response) {
          console.log(error.response.data); // Logs server error message
        } else if (error.request) {
          console.log(error.request); // Logs request if no response is received
        } else {
          console.log('Error', error.message); // Logs any other errors
        }
      }
    }
  };

  const getUserID = async () => {
    const token = localStorage.getItem('token');

    try {
      const { data } = await api.get('/user', {
        headers: { Authorization: `Bearer ${token}` }
      });
      // If the user is successfully registered, set their user ID
      setUserId(data.id);
    } catch (error) {
      if (error.response) {
        console.log(error.response); // Logs server error response
      } else if (error.request) {
        console.log(error.request); // Logs request if no response is received
      } else {
        console.log('Error', error.message); // Logs any other errors
      }
    }
  };

  const getHasLiked = async () => {

    try {
      const { data } = await api.get(`/feedback/opinion/${userId}/${song.id}`);
      console.log(data);
      if (data[0].agree === 1) {
        setHasLiked(1); // User has liked the classification
      } else {
        setHasLiked(2); // User has disagreed with the classification
      }
    } catch (error) {
      if (error.response) {
        console.log(error.response); // Logs server error response
      } else if (error.request) {
        console.log(error.request); // Logs request if no response is received
      } else {
        console.log('Error', error.message); // Logs any other errors
      }
    }
  };

  //Update hits(visits on the song) onLoad
  const updateHits = async () => {
    try {
      await api.post(`/song/hits/${song.id}`);
      // No need to handle response as nothing is done with it
    } catch (error) {
      if (error.response) {
        console.log(error.response); // Logs server error response
      } else if (error.request) {
        console.log(error.request); // Logs request if no response is received
      } else {
        console.log('Error', error.message); // Logs any other errors
      }
    }
  };


  const getHits = async () => {
    try {
      const { data } = await api.get(`/song/hits/${song.id}`);
      setHits(data);
    } catch (error) {
      if (error.response) {
        console.log(error.response); // Logs server error response
      } else if (error.request) {
        console.log(error.request); // Logs request if no response is received
      } else {
        console.log('Error', error.message); // Logs any other errors
      }
    }
  };

  const undoFeedback = async () => {
    try {
      await api.delete(`/feedback/${userId}/${song.id}`);
      setHasLiked(0);
      getAgrees();
      getDisagrees();
    } catch (error) {
      if (error.response) {
        console.log(error.response); // Logs server error response
      } else if (error.request) {
        console.log(error.request); // Logs request if no response is received
      } else {
        console.log('Error', error.message); // Logs any other errors
      }
    }
  };

  useEffect(() => {
    const fetchData = async () => {
      try {
        await getSong();
      } catch (error) {
        console.error('Error fetching song data:', error);
      }
    };

    fetchData();
  }, []);


  //Get the agrees and disagrees
  useEffect(() => {
    if (song) {
      const fetchData = async () => {
        try {
          setDate(new Date(song.date)); // Set the date of the song
          await Promise.all([
            getUserID(),
            getAgrees(),
            getDisagrees(),
            updateHits(),
            getHits()
          ]);
          // Set emotion icon based on song's general classification
          switch (song.general_classification) {
            case 'Calm':
              setEmotionIcon(faFaceSmile);
              break;
            case 'Tense':
              setEmotionIcon(faFaceGrimace);
              break;
            case 'Sad':
              setEmotionIcon(faFaceFrown);
              break;
            case 'Happy':
              setEmotionIcon(faSmileBeam);
              break;
            default:
              setEmotionIcon(null); // Fallback for unknown classifications
              break;
          }
        } catch (error) {
          console.error('Error fetching song data:', error);
        }
      };
      fetchData();
    }
  }, [song]);


  useEffect(() => {
    if (song) {
      getHasLiked();
    }
  }, [song, agrees]);

  useEffect(() => {
    if (song) {
      getHasLiked();
    }
  }, [song, disagrees]);

  if (isLoading) {
    return (
      <div>
        <NavBar scrolled={true} />
        <div className={style.Loading}>
          <img src={loading} alt="Loading..." />
        </div>
      </div>
    );
  }

  return (
    <>
      {song ? (
        <div className="super_container">
          <NavBar isNotAuthenticated={needsAuth}></NavBar>

          <Parallax
            className="parallax_background parallax-window"
            speed={0.8}
            bgImage={musicImage}>
            <div className={style.home}>
              <div
                className={classNames(
                  style.home_container,
                  'd-flex flex-column align-items-center justify-content-center'
                )}>
                <div className={classNames(style.home_content, 'text-center')}>
                  <div className={style.home_title}>
                    <h1>
                      {song.title}
                      <br />
                      {song.general_classification}{' '}
                    </h1>
                    <div className={classNames(style.home_subtitle, 'text-center')}>
                      {`${formatDate(date)}`}
                    </div>
                  </div>
                </div>
              </div>

              <div className={style.home_player_container}>
                <div className="container">
                  <div className="row">
                    <div className="col-lg-9 offset-lg-3">
                      <div
                        className={classNames(
                          style.player,
                          'd-flex flex-row align-items-start justify-content-start s1'
                        )}>
                        <div className={style.player_content}>
                          <img src={waveImage} alt="Waveform" />
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </Parallax>

          <div className={style.episode_container}>
            <div className={style.episode_image_container}>
              <div className="container">
                <div className="row">
                  <div className="col-lg-3">
                    <div className={style.episode_image}>
                      <img src={song.thumbnailHQ} alt={song.title} />
                    </div>
                  </div>
                </div>
              </div>
            </div>

            <div className="container">
              <div className="row">
                <div className={classNames('col-lg-3 order-lg-1 order-2', style.sidebar_col)}>
                  <div className={style.sidebar}>
                    <div className={style.sidebar_list}>
                      <div className={style.show_fav_count}>
                        <FontAwesomeIcon icon={emotionIcon} bounce></FontAwesomeIcon>{' '}
                        {song.general_classification}{' '}
                      </div>
                      <div className={style.show_fav_count}>
                        <FontAwesomeIcon icon={faEye}></FontAwesomeIcon> {hits} Views
                      </div>
                      <div className={style.show_fav_count}>
                        <FontAwesomeIcon icon={faCalendarDay}></FontAwesomeIcon>{' '}
                        {`${formatDate(date)}`}
                      </div>
                    </div>
                  </div>
                </div>

                <div className={classNames('col-lg-9', style.episode_col, 'order-lg-2 order-1')}>
                  <div className={style.AgreeOrDisagree}>
                    Do you agree with this classification ?
                    <div>
                      <div className={style.agree}>
                        <div className={style.page_nav}>
                          <ul className="d-flex flex-row">
                            <p>{agrees}</p>
                            <li className={hasLiked == 1 ? style.active : ''}>
                              {hasLiked == 1 ? (
                                <button onClick={undoFeedback}>
                                  <FontAwesomeIcon icon={faThumbsUp}></FontAwesomeIcon>
                                </button>
                              ) : (
                                <button onClick={() => agreeOrDisagree(1)}>
                                  <FontAwesomeIcon icon={faThumbsUp}></FontAwesomeIcon>
                                </button>
                              )}
                            </li>
                            <li className={hasLiked == 2 ? style.active : ''}>
                              {hasLiked == 2 ? (
                                <button className={style.thumbsDown} onClick={undoFeedback}>
                                  <FontAwesomeIcon icon={faThumbsDown}></FontAwesomeIcon>
                                </button>
                              ) : (
                                <button
                                  className={style.thumbsDown}
                                  onClick={() => agreeOrDisagree(2)}>
                                  <FontAwesomeIcon icon={faThumbsDown}></FontAwesomeIcon>
                                </button>
                              )}
                            </li>
                            <p>{disagrees}</p>
                          </ul>
                        </div>
                      </div>
                      <div className={style.disagree}></div>
                    </div>
                  </div>
                  <div className={style.intro}>
                    <div className={style.section_title}>{song.title}</div>
                    <div className={style.intro_text}>
                      <p>{song.description}</p>
                    </div>
                  </div>

                  <div className={style.guests}>
                    <iframe
                      width="560"
                      height="315"
                      src={`https://www.youtube.com/embed/${song.external_id}`}
                      title="YouTube video player"
                      style={{ border: 0 }}
                      allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                      allowfullscreen></iframe>
                  </div>

                  <div className={style.guests}>
                    <div className={style.section_title}>Classification Details</div>
                    <div className="accordion" id="accordion">
                      <div className="card">
                        <div className="card-header" id="headingOne">
                          <h2 className="mb-0">
                            <button
                              className="btn btn-link btn-block text-left"
                              type="button"
                              data-toggle="collapse"
                              data-target="#collapseOne"
                              aria-expanded="true"
                              aria-controls="collapseOne">
                              Lyrics Classification
                            </button>
                          </h2>
                        </div>

                        <div
                          id="collapseOne"
                          className={classNames('collapse', style.show)}
                          aria-labelledby="headingOne"
                          data-parent="#accordion">
                          <div className="card-body">
                            Some placeholder content for the first accordion panel. This panel is
                            shown by default, thanks to the <code>.show</code> class.
                          </div>
                        </div>
                      </div>
                      <div className="card">
                        <div className="card-header" id="headingTwo">
                          <h2 className="mb-0">
                            <button
                              className="btn btn-link btn-block text-left collapsed"
                              type="button"
                              data-toggle="collapse"
                              data-target="#collapseTwo"
                              aria-expanded="false"
                              aria-controls="collapseTwo">
                              Vocals Classification
                            </button>
                          </h2>
                        </div>
                        <div
                          id="collapseTwo"
                          className="collapse"
                          aria-labelledby="headingTwo"
                          data-parent="#accordion">
                          <div className="card-body">
                            Some placeholder content for the second accordion panel. This panel is
                            hidden by default.
                          </div>
                        </div>
                      </div>
                      <div className="card">
                        <div className="card-header" id="headingThree">
                          <h2 className="mb-0">
                            <button
                              className="btn btn-link btn-block text-left collapsed"
                              type="button"
                              data-toggle="collapse"
                              data-target="#collapseThree"
                              aria-expanded="false"
                              aria-controls="collapseThree">
                              Instrumental Classification
                            </button>
                          </h2>
                        </div>
                        <div
                          id="collapseThree"
                          className="collapse"
                          aria-labelledby="headingThree"
                          data-parent="#accordion">
                          <div className="card-body">
                            And lastly, the placeholder content for the third and final accordion
                            panel. This panel is hidden by default.
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>

          <Footer></Footer>
          {/**/}
        </div>
      ) : (
        <div className="super_container">
          <NavBar active={3} scrolled={true}></NavBar>

          <div className={style.songNotAvailable}>
            <div className={style.songNotAvailable_Image}>
              <img src={notAvailable}></img>
            </div>
            <div className={style.songNotAvailable_Text}>This song is not available</div>
          </div>
        </div>
      )}
    </>
  );
}
export default Music;
